                    labelDiv.className = 'label';
                    labelDiv.style.cssText = 'font-size: 11px !important;';
                    labelDiv.textContent = 'Rotten Tomatoes Critic Consensus';

                    // Create content table
                    const contentTable = document.createElement('table');
                    contentTable.className = 'contentlayout';
                    contentTable.setAttribute('cellspacing', '0');
                    contentTable.style.cssText = 'font-size: 11px !important;';

                    const contentBody = document.createElement('tbody');
                    contentBody.style.cssText = 'font-size: 11px !important;';

                    const contentRow = document.createElement('tr');
                    contentRow.style.cssText = 'font-size: 11px !important;';

                    const contentCell = document.createElement('td');
                    contentCell.style.cssText = 'font-size: 11px !important;';
