    function tryUrl(url, movieInfo) {
        return new Promise((resolve, reject) => {
            GM_xmlhttpRequest({
                method: 'GET',
                url: url,
                onload: function(response) {
                    console.log("[HDBits RT Script] Trying URL:", url, "Status:", response.status);
                    if (response.status === 200 && verifyMovie(response.responseText, movieInfo)) {
                        resolve({ url, response });
                    } else {
                        reject();
                    }
                },
                onerror: reject
            });
        });
    }

    function parseRatingsFromHtml(html) {
        const parser = new DOMParser();
        const doc = parser.parseFromString(html, 'text/html');

        const result = {
            criticScore: null,
            audienceScore: null,
            criticState: 'na',
            audienceState: 'na',
            criticReviewsCount: null,
            audienceRatingsCount: null,
            criticConsensus: null
        };

        try {
            // First try to get the consensus since it's a separate element
            const consensusElement = doc.querySelector('#critics-consensus p');
            if (consensusElement) {
                result.criticConsensus = consensusElement.textContent.trim();
                console.log("[HDBits RT Script] Found critic consensus");
            } else {
                console.log("[HDBits RT Script] No critic consensus available");
            }

            // Find and parse the scorecard JSON data
            const scorecardScript = doc.querySelector('#media-scorecard-json');
            if (scorecardScript) {
                try {
                    const scorecardData = JSON.parse(scorecardScript.textContent);
                    console.log("[HDBits RT Script] Found scorecard data:", scorecardData);

                    // Parse critic score and state
                    if (scorecardData.criticsScore) {
                        const parsedScore = parseInt(scorecardData.criticsScore.score);
                        if (!isNaN(parsedScore)) {
                            result.criticScore = parsedScore;
                            result.criticState = scorecardData.criticsScore.certified ? 
                                'certified_fresh' : 
                                (parsedScore >= 60 ? 'fresh' : 'rotten');
                        } else {
                            result.criticScore = null;
                            result.criticState = 'na';
                        }
                    }

                    // Parse audience score and state
                    if (scorecardData.audienceScore) {
                        const parsedScore = parseInt(scorecardData.audienceScore.score);
                        if (!isNaN(parsedScore)) {
                            result.audienceScore = parsedScore;
                            result.audienceState = scorecardData.audienceScore.certified ? 
                                'verified_hot' : 
                                (parsedScore >= 60 ? 'upright' : 'spilled');
                        } else {
                            result.audienceScore = null;
                            result.audienceState = 'na';
                        }
                    }

                    // Get review counts
                    if (scorecardData.criticsScore) {
                        result.criticReviewsCount = `${scorecardData.criticsScore.reviewCount || 0} Reviews`;
                    }
                    if (scorecardData.audienceScore) {
                        result.audienceRatingsCount = scorecardData.audienceScore.bandedRatingCount || 'No Ratings';
                    }

                    console.log("[HDBits RT Script] Successfully parsed from JSON");
                } catch (parseError) {
                    console.log("[HDBits RT Script] Error parsing scorecard JSON:", parseError);
                    // Fall back to DOM parsing if JSON parsing fails
                    parseFromDOM();
                }
            } else {
                console.log("[HDBits RT Script] No scorecard JSON found, using DOM parsing");
                parseFromDOM();
            }

            console.log("[HDBits RT Script] Final parsed ratings:", result);
        } catch (e) {
            console.log("[HDBits RT Script] Error parsing ratings:", e);
        }

        return result;

        // Helper function for DOM parsing fallback
        function parseFromDOM() {
            // Find critic score using rt-text with criticsScore slot
            const criticScoreElement = doc.querySelector('rt-text[slot="criticsScore"]');
            if (criticScoreElement) {
                const scoreMatch = criticScoreElement.textContent.match(/(\d+)%/);
                if (scoreMatch) {
                    const parsedScore = parseInt(scoreMatch[1]);
                    if (!isNaN(parsedScore)) {
                        result.criticScore = parsedScore;
                        result.criticState = result.criticScore >= 60 ? 'fresh' : 'rotten';
                    }
                }
            }

            // Find audience score using rt-text with audienceScore slot
            const audienceScoreElement = doc.querySelector('rt-text[slot="audienceScore"]');
            if (audienceScoreElement) {
                const scoreMatch = audienceScoreElement.textContent.match(/(\d+)%/);
                if (scoreMatch) {
                    const parsedScore = parseInt(scoreMatch[1]);
                    if (!isNaN(parsedScore)) {
                        result.audienceScore = parsedScore;
                        const audienceIcon = doc.querySelector('score-icon-audience[certified="true"]');
                        result.audienceState = audienceIcon ? 
                            'verified_hot' : 
                            (parsedScore >= 60 ? 'upright' : 'spilled');
                    }
                }
            }

            // Find critic review count
            const criticReviewsElement = doc.querySelector('rt-link[slot="criticsReviews"]');
            if (criticReviewsElement) {
                result.criticReviewsCount = criticReviewsElement.textContent.trim();
            }

            // Find audience rating count
            const audienceReviewsElement = doc.querySelector('rt-link[slot="audienceReviews"]');
            if (audienceReviewsElement) {
                result.audienceRatingsCount = audienceReviewsElement.textContent.trim();
            }
        }
    }

